import autumn from './images/autumn.jpeg';
import blueflower from './images/blue-flower.jpeg';
import blurredlight from './images/blurred-light.jpeg';
import cold from './images/cold.jpeg';
import ballon from './images/ballon.jpeg';
import lion from './images/lion.jpeg';
import mapleleaf from './images/maple-leaf.jpeg';
import bluejays from './images/bluejays.jpg';
import snow from './images/snow.jpeg';
import red from './images/Sonic.jpg';
import raptors from './images/raptors.jpeg';
import leafs from './images/leafs-logo-620.jpg';

const images = [
  autumn,
  blueflower,
  blurredlight,
  cold,
  ballon,
  lion,
  mapleleaf,
  bluejays,
  snow,
  red,
  raptors,
  leafs,
];

export default images;
